# Difference between case
DIFF = ord('a') - ord('A')

# Using Stack method
# 'rem' is capitalised character to remove
def Stack(r,rem):
	stack = []

	for a in r:
		# Don't calculate removed
		if a != rem and a != rem+DIFF:

			# If stack not empty
			# And same letter, different case
			if len(stack) and abs(a - stack[-1]) == DIFF:
				stack.pop()
			else:
				stack.append(a)

	return stack

